// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.2 <0.9.0;

import "contracts/BlockMaster.sol";

contract AuctionContract
{
    address payable auctionManager;//saving final ether value

    ItemMaster public auctionItem;//acs globally 
    BiddersMaster auctionBidder;

    uint regNo;
    uint chainNo;
    mapping(uint=>BiddersMaster) auctionBidderRegister;
    mapping (uint=>AuctionRegister) auctionChain;

    AuctionRegister public winner;

    uint maxBidValue;

    constructor() payable 
    {  ///wanna deploy ths 1st contft 
        auctionManager= payable(msg.sender);
        regNo=0;
        
    }

    //  MODIFIERS 

    modifier checkAuctionManager()
        {
            require(msg.sender==auctionManager,"Invalid... Not real Auction Manager Account...");
            _;
        }

    modifier checkUserIsNotAuctionManager()
        {
            require(msg.sender!=auctionManager,"Action Deny... Auction Manager can't Participate as Bidder");
            _;
        }

    modifier checkAuctionBidderRegister()
    {
        BiddersMaster memory userblock;
        bool token=false;
        uint regcnt=0;
        while(regcnt < regNo)
        {
            userblock=auctionBidderRegister[regcnt];
            if(userblock.bidderAddress == msg.sender)
                {
                        token=true;
                        break;
                }
            regcnt++;
        }
        require(token==false,"Action Deny... Dear Bidder, You are already regitered..");
        _;
    }

    modifier checkAuctionBidderExistence()
    {
        BiddersMaster memory userblock;
        bool token=false;
        uint regcnt=0;
        while(regcnt < regNo)
        {
            userblock=auctionBidderRegister[regcnt];
            if(userblock.bidderAddress == msg.sender)
                {
                        token=true;
                        break;
                }
            regcnt++;
        }
        require(token==true,"Action Deny... Dear Guest, Please Book Your Seat for Auction Room");
        _;
    }

    //modifier with Arg
    modifier checkBidValue(uint bidderValue)
    {
        require(bidderValue>maxBidValue,"Bidding ActionDeny... Invalid Bid Value..");
        _;
    }

    modifier  checkWinnerAddress()
    {
        require(msg.sender == winner.userAddress,"Action Deny.. Not Valid Transaction ADDRESS");
        _;
    }

    modifier checkTransactionAmount() 
    {
        //uint logical ETH == ETH (X) = Wei (CORRECT)
        //   2 = 2000000000000000000; 
        uint ethtowei = winner.bidValue * 1000000000000000000;

        require(ethtowei == msg.value,"Action Deny.. Not Valid Transaction VALUE");
        _;
    }

    modifier checkItemBiddingStatus()
    {
        require(auctionItem.auctionResult==false,"Auction Over, Thank You!");
      _;  
    }

    /**************** END OF MODIFIRES ********************/





    /*****************  AUCTION Functions  ****************/
    // BidValue = ETH
    function setAuctionItem(string memory name,uint bidValue) public checkAuctionManager()
    {
        auctionItem=ItemMaster(name,bidValue,false);
        maxBidValue=bidValue;
        chainNo=0;
    }

    function BidderRegisterMaster(string memory name) public checkUserIsNotAuctionManager() checkAuctionBidderRegister()
    {
        //NEW BIDDER
        auctionBidderRegister[regNo]=BiddersMaster(name,payable(msg.sender));
        gotoNextBidder();
    }

    function gotoNextBidder() private
    {
        regNo++;
    }

    function MyBidding(uint myBidValue) public 
    checkItemBiddingStatus()
    checkUserIsNotAuctionManager() 
    checkAuctionBidderExistence()
    checkBidValue(myBidValue)
    {
       // Add this Block 
        AuctionRegister memory auctionblock=AuctionRegister(payable(msg.sender),myBidValue);
        auctionChain[chainNo]=auctionblock;

        maxBidValue = myBidValue;
       gotoNextBlockchain();
    }

    function gotoNextBlockchain() private
    {
        chainNo++;
       // [0] 4  [1] 6 [2] 9 [3] 12 [4]->N/A
    }


    function declareAuctionResult() public checkAuctionManager()
    {
        uint winnerIndex = chainNo - 1;
        winner=auctionChain[winnerIndex];
        
        auctionItem=ItemMaster(auctionItem.itemName,auctionItem.initBidValue,true);
        
    }

    function transferBidAmount() public  payable 
    checkUserIsNotAuctionManager()
    checkWinnerAddress()
    checkTransactionAmount()
    {
           // Trans
           auctionManager.transfer(msg.value); 

    }

    /*****************  End of AUCTION Functions  ***************/
}

