pragma solidity >=0.8.2 <0.9.0;

struct ItemMaster
{
    string itemName;
    uint initBidValue;
    bool auctionResult;
}

struct BiddersMaster
{
    string bidderName;
    address payable bidderAddress;
    //uint bidValue;
}

struct AuctionRegister
{
    address userAddress;
    uint bidValue;
}

